import React, { useContext, useEffect } from 'react'
import { UrlsContext } from '../contexts/UrlsContext'

const UrlsList = () => {
  const { links, linksDispatch } = useContext(UrlsContext)

  useEffect(() => {
    console.log(links)
  }, [links])

  return (
    <div>
      <h1>Urls</h1>
      {links.length !== 0 ? (
        links.map((link, index) => (
          <div key={index}>
            <p>{link}</p>
            <button
              onClick={() =>
                linksDispatch({ type: 'DELETE_LINK', id: link.id })
              }
            >
              Delete
            </button>
          </div>
        ))
      ) : (
        <p>No urls here!</p>
      )}
    </div>
  )
}

export default UrlsList
